import { Route, Switch } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import QuoteDetails from "./pages/QuoteDetails";

function App() {
  return (
    <div>
      <main>
        <Switch>
          <Route path='/quotes'>
            <AllQuotes/>
          </Route>
          <Route path='/quotes/:quoteId'>
            <QuoteDetails />
          </Route>
          <Route path='new-quote'>

          </Route>
        </Switch>
      </main>
    </div>
  );
}

export default App;
